import "./App.scss";
import AppRoutes from "./Routes";
import "./reset.css";
import { useState, useEffect } from "react";

const Overlay = () => {
  return <div className="overlay"></div>;
};


function App() {
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    const timeOut = setTimeout(() => {
      setIsLoading(false);
    }, 2000);

    return () => clearTimeout(timeOut);
  }, []);
  return (
    <div className="App">
      <AppRoutes/>
    </div>

  );
}

export default App;
